import React from 'react';

export default function Dashboard() {

  const getSharksData = async () => {
    const response = await fetch('https://localhost:8081/sharks');
    const data = await response.json();
    console.log(data);
  }

  return(
    <h2>Dashboard</h2>
  );
}
